import React, { useEffect, useState } from "react";
import Product from "./components/Product";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const App = () => {
  useEffect(() => {
    fetchItems();
  }, []);

  const [items, setItems] = useState([]);

  const fetchItems = async () => {
    const data = await fetch("https://fakestoreapi.com/products");
    const items = await data.json();
    setItems(items);
  };

  return (
    <div className="App">
      <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/product">product</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
        </div>
    </Router>


      <ul>
        {items.map((items) => (
          <li>
            <p>Titre :</p>
            {items.title} 
            <p>price :</p>
            {items.price}
          </li>
        ))}
      </ul>
    </div>
  );
};
function Home() {
  return <h2>Home</h2>;
}

export default App;
